syntax = "proto3";
package classlink;
option java_package = "com.classlink.websocket.api.member.domain.param.proto";
option java_outer_classname = "MemberIdentityInfo";

message CwclassMemberIdentityInfo {
  string MemNickname = 1;
  string MemName = 2;
  string MemEmail = 3;
  string MemPhone = 4;
}